import axios from 'axios';
import React from 'react';

const Sresult= (props)=>{
    
     const img = axios.get(`https://api.unsplash.com/`);
     

     return (
          <>
               <img src={img} alt='this is image'/>
          </>
     )
}
export default Sresult
